window.bookSummaryJSON = "<p>Princess Cordelia is used to being overshadowed by her many brothers and sisters. So when she's offered the chance to attend her brother's wedding in a faraway kingdom, she leaps at it. In Northhelm, she'll finally have the chance to stand out. And maybe, just maybe, she'll even find romance.</p> <p>But not everything in the Northhelmian court is as it appears. With her brother distracted by the wedding, only Ferdinand, the ugliest man at court, will listen to Cordelia's concerns. An observant princess and a strangely amphibious soldier may be the only thing standing between all Four Kingdoms and disaster.</p> <p>Cordelia will have to overcome prejudice, deceit, and danger if she wants to save the day and find romance in <i>A Midwinter's Wedding</i>.</p>"; 
